import React from 'react'
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import Offcanvas from 'react-bootstrap/Offcanvas';
import { NavLink } from "react-router-dom";
import Button from 'react-bootstrap/Button';

function Home() {
  return (
    <>
    {[false].map((expand) => (
      <Navbar key={expand} expand={expand} className="bg-body-tertiary mb-3">
        <Container fluid>
          <Navbar.Brand href="#">HealthConnect: Streamlined Doctors Appointment And Health Record Management</Navbar.Brand>
          <Navbar.Toggle aria-controls={`offcanvasNavbar-expand-${expand}`} />
          <Navbar.Offcanvas
            id={`offcanvasNavbar-expand-${expand}`}
            aria-labelledby={`offcanvasNavbarLabel-expand-${expand}`}
            placement="end"
          >
            <Offcanvas.Header closeButton>
              <Offcanvas.Title id={`offcanvasNavbarLabel-expand-${expand}`}>
                Describe yourself!!
              </Offcanvas.Title>
            </Offcanvas.Header>
            <Offcanvas.Body>
            
              <Nav className="justify-content-end flex-grow-1 pe-3">
              <div className="d-grid gap-4">
                <NavLink to="/login-admin"><Button variant="dark" size="lg">admin</Button></NavLink>{`
                
                `}
                <NavLink to="/login-doctor"><Button variant="dark" size="lg">doctor</Button></NavLink>{`
                
                `}
                <NavLink to="/login-patient"><Button variant="dark" size="lg">patient</Button></NavLink>
                </div>
              </Nav>
             
              
              <Nav className="justify-content-end flex-grow-1 pe-3">
                <div className="d-grid gap-4">
                <NavLink to="/signup-doctor"><Button variant="dark" size="lg">doctor</Button></NavLink>
                <NavLink to="/signup-patient"><Button variant="dark" size="lg">patient</Button></NavLink>
                </div>
              </Nav>
              
            </Offcanvas.Body>
          </Navbar.Offcanvas>
        </Container>
      </Navbar>
    ))}
  </>
  )
}

export default Home
